return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2018-12-11 14:56:44+0000','plural-forms'=>'nplurals=1; plural=0;','project-id-version'=>'WordPress - 5.2.x - Administration - Network Admin','language'=>'km_KH','messages'=>['subdirectory exampleslike <code>%1$s/site1</code> and <code>%1$s/site2</code>'=>'ដូចជា <code>%1$s/វេបសាយ 1</code> and <code>%1$s/វេបសាយ 2</code>','Server Address'=>'អាសយដ្ឋាន​ម៉ាស៊ីន​បម្រើ','Add the designated lines of code to wp-config.php (just before <code>/*...stop editing...*/</code>) and <code>.htaccess</code> (replacing the existing WordPress rules).'=>'បន្ថែម​កូដ​ទាំង​ប៉ុន្មាន​បន្ទាត់​ដែល​បាន​រៀបចំ​មក​នេះ ចូលទៅ​ក្នុង wp-config.php (ដាក់​នៅ​មុន <code>/*...stop editing...*/</code>) និង <code>.htaccess</code> (ជួស​វិធាន (rule) របស់ WordPress ដែល​មាន​ក្នុង​នោះ)។','The main site in a sub-directory installation will need to use a modified permalink structure, potentially breaking existing links.'=>'វេបសាយចម្បងដែលបានតម្លើងនៅក្នុងថតរង នឹងត្រូវការប្រើនូវទម្រង់នៃតំណដែលបានកែប្រែ ជាពិសេសគឺតំណមានស្រាប់តែខូច។','Because your installation is in a directory, the sites in your WordPress network must use sub-directories.'=>'ដោយសារតែការតម្លើងរបស់អ្នកស្ថិតនៅក្នុងថតមួយ នោះវេបសាយនានាដែលនៅលើបណ្ដាញរបស់អ្នកត្រូវតែប្រើថតរង។','Because your installation is not new, the sites in your WordPress network must use sub-domains.'=>'ដោយសារតែការតម្លើងរបស់អ្នកមិនមែនជាការតម្លើងថ្មី វេបសាយទាំងអស់នៅក្នុងបណ្ដាញ WordPress របស់អ្នក ត្រូវតែប្រើ sub-domains។','Network Title'=>'ឈ្មោះ​បណ្ដាញ','What would you like to call your network?'=>'តើ​អ្នក​ចង់​ហៅ​បណ្ដាញ​របស់​អ្នក​ថា​យ៉ាង​ម៉េច?','Your email address.'=>'អាសយដ្ឋាន​អ៊ីមែល​របស់​អ្នក។','The original configuration steps are shown here for reference.'=>'ជំហានកំណត់រចនាសម្ព័ន្ធលំនាំដើម និងត្រូវបង្ហាញនៅទីនេះ ជាសំអាង។','An existing WordPress network was detected.'=>'បាន​រកឃើញ​ថា​មាន​បណ្ដាញ WordPress មួយ​រួច​ហើយ។','Please complete the configuration steps. To create a new network, you will need to empty or remove the network database tables.'=>'សូមសម្រេចជំហានកំណត់រចនាសម្ព័ន្ធ។ ដើម្បីបង្កើតបណ្ដាញថ្មី, អ្នកចាំបាច់ត្រូវតែគ្មាន ឬ​យកចេញនូវតារាងមូលដ្ឋានទិន្នន័យបណ្ដាញណែតវើក។','Enabling the Network'=>'ការ​បើក​ដំណើរការ​បណ្ដាញ','Complete the following steps to enable the features for creating a network of sites.'=>'បញ្ចប់​ជំហាន​ទាំង​នេះ ដើម្បី​បើក​មុខងារ​នានា​សម្រាប់​ការ​បង្កើត​បណ្ដាញ​វេបសាយ។','Confirm'=>'បញ្ជាក់','Cannot create an empty user.'=>'មិន​អាច​បង្កើត​អ្នក​ប្រើ​ទទេឡើយ។','Duplicated username or email address.'=>'ឈ្មោះ​អ្នក​ប្រើ​ឬ​ក៏​អាសយដ្ឋាន​អ៊ីមែល​ស្ទួន​គ្នា។','Allow new registrations'=>'អនុញ្ញាត​ការ​ចុះ​ឈ្មោះ​ថ្មី','Registration notification'=>'ការ​ជូន​ដំណឹង​អំពី​ការ​ចុះ​ឈ្មោះ','Add New Users'=>'បន្ថែម​អ្នក​ប្រើ​ថ្មី','Banned Names'=>'ឈ្មោះ​ដែល​បាន​ហាម​ឃាត់','Limited Email Registrations'=>'អ៊ីមែលដែលចុះបញ្ញីឈ្មោះ ត្រូវបានកំរិត។','Banned Email Domains'=>'ឈ្មោះ​ដែន​អ៊ីមែល​ដែល​បាន​ទប់ស្កាត់','Welcome Email'=>'អ៊ីមែល​ស្វាគមន៍','Welcome User Email'=>'អ៊ីមែល​ស្វាគមន៍​អ្នកប្រើ','The welcome email sent to new users.'=>'បាន​ផ្ញើ​អ៊ីមែល​ស្វាគមន៍​ទៅ​កាន់​អ្នក​ប្រើ​ថ្មី។','First Page'=>'ទំព័រ​ដំបូង','First Comment'=>'មតិដំបូងគេ','First Comment Author'=>'មតិអ្នកនិពន្ធដំបូងគេ','First Comment URL'=>'URL នៃ​មតិ​ដំបូង','Max upload file size'=>'ទំហំអតិបរមារបស់ឯកសារអាប់ឡូដ','Default Language'=>'ភាសា​លំនាំ​ដើម','Add Site'=>'បន្ថែម​វេបសាយ','Admin Email'=>'អ៊ីមែល​អ្នក​គ្រប់គ្រង','A new user will be created if the above email address is not in the database.'=>'អ្នក​ប្រើថ្មី​ម្នាក់​នឹង​ត្រូវ​បាន​បង្កើត ប្រសិន​បើ​អាសយដ្ឋាន​អ៊ីមែល​ខាង​លើ​មិន​មាន​នៅ​ក្នុង​មូលដ្ឋាន​ទិន្នន័យ​ទេ។','Sites deleted.'=>'វេបសាយ បានលុប។','Site deleted.'=>'បាន​លុប​វេបសាយ។','Site marked as spam.'=>'បាន​ចំណាំ​វេបសាយ​ថា​ជា​ស្ប៉ាម។','Network Admin Email'=>'អ៊ីមែល​អ្នកគ្រប់គ្រងណេតវើក','[%s] New Site Created'=>'[%s] ​វេបសាយ​ថ្មីបាន​បង្កើត','The welcome email sent to new site owners.'=>'​អ៊ីមែល​ស្វាគមន៍​បានផ្ញើរទៅ​ម្ចាស់​វេបសាយ​ថ្មី។','Site upload space'=>'កន្លែងអាប់ឡូដវេបសាយ','If you want to limit site registrations to certain domains. One domain per line.'=>'ប្រសិនជាអ្នកចង់កំរិតការចុះបញ្ជីវេបសាយ ទៅដូមេនជាក់លាក់។ មួយដូមេន ក្នុងមួយបន្ទាត់។','Send the network admin an email notification every time someone registers a site or user account'=>'ផ្ញើអ៊ីម៊ែលជូនដំណឹងទៅកាន់អ្នកគ្រប់គ្រងបណ្ដាញនៅរៀងរាល់ពេលដែលមានការបង្កើតវេបសាយថ្មី ឬក៏គណនីអ្នកប្រើថ្មី','Users are not allowed to register these sites. Separate names by spaces.'=>'អ្នកប្រើមិនត្រូវបានអនុញ្ញាឲ្យចុះបញ្ញីវេបសាយពួកគេ។ ឈ្មោះដាច់ដោយឡែកពីគ្នាដោយការដកឃ្លា។','If you want to ban domains from site registrations. One domain per line.'=>'ប្រសិនអ្នកចង់បិទ ដូមេនពីអ្នកចុះបញ្ជីវេបសាយ។ មួយដូមេន ក្នុងមួយបន្ទាត់។','Next Sites'=>'វេបសាយ​បន្ទាប់','Enable administration menus'=>'បើក​ម៉ឺនុយ​គ្រប់គ្រង','Operational Settings'=>'ការកំណត់ប្រតិបត្តិការ','Upload Settings'=>'កំណត់​ការ​ផ្ទុក​ឡើង','Missing or invalid site address.'=>'អាសយដ្ឋាន​វេបសាយ​ខ្វះ ឬ​ក៏មិនត្រឹមត្រូវ។','Missing email address.'=>'ខ្វះអាសយដ្ឋានអ៊ីមែល។','New Site Settings'=>'ការ​កំណត់វេបសាយ​ថ្មី','Registration Settings'=>'កំណត់​ការ​ចុះ​ឈ្មោះ','Logged in users may register new sites'=>'អ្នកប្រើដែលបានចូល អាចបង្កើតវេបសាយថ្មីបាន។','Both sites and user accounts can be registered'=>'ទាំងវេបសាយ និងអ្នកប្រើ សុទ្ធតែអាចបង្កើតបាន','User accounts may be registered'=>'គណនីអ្នកប្រើទាំងនេះ ប្រហែលបានចុះឈ្មោះហើយ','Registration is disabled'=>'ការចុះឈ្មោះត្រូវបានបិទ','All done!'=>'រួចរាល់​ហើយ!','Sites marked as spam.'=>'បាន​ចំណាំ​វេបសាយ​ថា​ជា​ស្ប៉ាម។','Users marked as spam.'=>'អ្នកប្រើបានសម្គាល់ជាសារឥតបាន។','Upload file types'=>'ប្រភេទ​ឯកសារ​ផ្ទុកឡើង','The author of the first comment on a new site.'=>'អ្នកនិពន្ធ​ បានមានមតិ​ដំបូងលើវេបសាយថ្មី។','The first post on a new site.'=>'ប្រកាដ​ដំបូង​នៅ​លើ​វេបសាយ​ថ្មី។','The first page on a new site.'=>'ទំព័រដំបូងគេ លើវេបសាយថ្មី។','The first comment on a new site.'=>'មតិដំបូងគេ លើវេបសាយថ្មី។','The URL for the first comment on a new site.'=>'អាស័យដ្ឋានសម្រាប់មតិដំបូងគេ លើវេបសាយថ្មី។','There was an error creating the user.'=>'កំហុសក្នុងការបង្កើតអ្នកប្រើ។','Sorry, you are not allowed to change the current site.'=>'សុំទោស, អ្នក​មិន​ត្រូវ​បាន​អនុញ្ញាត​ឲ្យ​ផ្លាស់ប្ដូរ​វេបសាយបច្ចុប្បន្ន​ទេ។','Site deactivated.'=>'បាន​បិទ​ដំណើរការ​វេបសាយ។','Site activated.'=>'បាន​ធ្វើ​ឲ្យ​វេបសាយ​សកម្ម។','Site unarchived.'=>'វេបសាយ​មិនមែនបណ្ណាសារ។','Limit total size of files uploaded to %s MB'=>'ទំហំសរុបដែលបានកំនត់សម្រាប់ ផ្ទុកឯកសារឡើងទៅ %s MB','Users deleted.'=>'បាន​លុប​អ្នក​ប្រើ។','Sites removed from spam.'=>'បាន​ដក​វេបសាយ​ចេញ​ពី​ស្ប៉ាម។','Can&#8217;t create an empty site.'=>'មិនអាចបង្កើតវេបសាយដែលទទេរ។','If your browser doesn&#8217;t start loading the next page automatically, click this link:'=>'ប្រសិន​បើ​កម្មវិធី​បើក​អ៊ីនធឺណិត​របស់​អ្នក​មិន​ចាប់​ផ្ដើម​ផ្ទុក​ទំព័រ​បន្ទាប់​ដោយ​ស្វ័យ​ប្រវត្តិ​ទេ​នោះ អ្នក​អាច​ចុច​តំណ​នេះ៖','Site archived.'=>'វេបសាយ បណ្ណាសារ','Users removed from spam.'=>'បានដក​អ្នក​ប្រើ​ចេញ​ពី​ស្ប៉ាម។','Site removed from spam.'=>'បាន​ដក​វេបសាយ​ចេញ​ពី​ស្ប៉ាម។','The following words are reserved for use by WordPress functions and cannot be used as blog names: %s'=>'តាមរយះពាក្យ "បម្រុងទុក"ខាងក្រោម ប្រើដោយមុខងារWordPress និងមិនអាចប្រើជាឈ្មោះប្លុក៖ %s','New site settings are defaults applied when a new site is created in the network. These include welcome email for when a new site or user account is registered, and what&#8127;s put in the first post, page, comment, comment author, and comment URL.'=>'ការកំណត់វេសាយថ្មីជាលំនាំដើមនឹងត្រូវអនុវត្ត នៅពេលដែលវេបសាយថ្មី ត្រូវបានបង្កើតក្នុងបណ្ដេញ។ រួមទាំងអ៊ីម៉ែលស្វាគមន៍ សម្រាប់ពេលដែលវេបសាយថ្មី ឬគណនីអ្នកប្រើថ្មី ត្រូវបានបង្កើតនិងអ្វីជាច្រើនដាក់ក្នុងប្រកាសដំបូង, ទំព័រ, មតិ, យោបល់អ្នកនិពន្ធ,នឹងអាស័យដ្ឋានមតិ។','Fill in the information below and you&#8217;ll be on your way to creating a network of WordPress sites. We will create configuration files in the next step.'=>'បំពេញព័ត៌មានខាងក្រោម ហើយអ្នកនឹងស្ថិតនៅលើផ្លូវទៅកាន់ការបង្កើតណេតវើករបស់ WordPress វេបសាយ។ យើងនឹងបង្កើតឯកសារការកំណត់រចនាសម្ព័ន្ធនៅក្នុងជំហានបន្ទាប់។','Note:'=>'ចំណាំ៖','This is the main table of all sites on this network. Switch between list and excerpt views by using the icons above the right side of the table.'=>'នេះជាតារាងចំបងនៃវេបសាយទាំងអស់នៅលើបណ្តាញនេះ។  ប្ដូររវាងបញ្ជី និងសេចក្ដីដកស្រង់ទិដ្ធភាពដោយប្រើរូបតំណាងនៅខាងលើផ្នែកខាងស្តាំនៃតារាង។','You can sort the table by clicking on any of the table headings and switch between list and excerpt views by using the icons above the users list.'=>'អ្នកអាចតម្រៀបតារាង ដោយការចុចលើមួយណានៃក្បាលតារាង​ និងប្ដូររវាងបញ្ជីនឹង មើលសេចក្ដីដកស្រង់ ដោយការប្រើអាយខនខាងលើក្នុងបញ្ជីរបស់អ្នកប្រើ។','If this process fails for any reason, users logging in to their sites will force the same update.'=>'ប្រសិនបើដំណើរការនេះបានបរាជ័យសម្រាប់ហេតុផលណាមួយ, អ្នកប្រើឡុកចូលទៅក្នុងវេបសាយរបស់ខ្លួននឹងមានសិទ្ធិ ធ្វើបច្ចុប្បន្នភាពមួយចំនួន។','If a version update to core has not happened, clicking this button won&#8217;t affect anything.'=>'ប្រសិនបើការធ្វើបច្ចុប្បន្នភាពជំនាន់ ដើម្បីស្នូលមិនបានកើតឡើង ចុចប៊ូតុងនេះ និងមិនប៉ះពាល់ដល់អ្វីគ្រប់យ៉ាង។','This screen enables and disables the inclusion of themes available to choose in the Appearance menu for each site. It does not activate or deactivate which theme a site is currently using.'=>'អេក្រង់នេះ បើកនិងបិទ ត្រូវបានដាក់បញ្ជូលរូបរាងដែលអាចប្រើបាន ដើម្បីជ្រើសរើសក្នុងបញ្ជីទិដ្ឋភាពសម្រាប់វេបសាយនេះ។ វាមិនត្រូវបានសកម្ម ឬអសកម្មនៅពេលមួយដែលរូបរាងវេបសាយបានប្រើប្រាស់ពេលបច្ចុប្បន្ន។','If the network admin disables a theme that is in use, it can still remain selected on that site. If another theme is chosen, the disabled theme will not appear in the site&#8217;s Appearance > Themes screen.'=>'ប្រសិនបើអ្នកគ្រប់គ្រងបណ្តាញបិទមិនអោយដំណើរការរូបរាងមួយដែលកំពុងប្រើ នោះវានៅតែអាចត្រូវបានជ្រើសរើសនៅលើវេបសាយនោះដដែល។ ប្រសិនបើរូបរាងផ្សេងទៀតត្រូវបានជ្រើសរើស នោះរូបរាងដែលបានបិទនឹងមិនលេចឡើងនៅលើវេបសាយ Appearance > Themes screen ទេ។','This screen sets and changes options for the network as a whole. The first site is the main site in the network and network options are pulled from that original site&#8217;s options.'=>'ទំព័រ​នេះ​អាច​កំណត់​ឬ​ផ្លាស់​ប្ដូរ​ជម្រើស​នានា​សម្រាប់​បណ្ដាញ​ទាំងមូល។ វេបសាយ​ដំបូង​គឺ​ជា​វេបសាយ​ចម្បង​នៅ​ក្នុង​បណ្ដាញ ហើយ​ជម្រើស​បណ្ដាញ​ត្រូវ​បាន​ទាញ​យក​មក​ពី​ជម្រើស​នៃ​វេបសាយ​ដើម។','Registration settings can disable/enable public signups. If you let others sign up for a site, install spam plugins. Spaces, not commas, should separate names banned as sites for this network.'=>'ការកំណត់ការចុះឈ្មោះអនុញ្ញាតអោយបិទឬបើកការចុះឈ្មោះជាសាធារណៈបាន។ ប្រសិនបើអ្នកអនុញ្ញាតឱ្យអ្នកផ្សេងចុះឈ្មោះនៅលើវេបសាយ សូមដំឡើងកម្មវិធីបន្ថែមដើម្បីការពារស្ប៉ាម។ ដំណកឃ្លាដែលមិនមានជាសញ្ញាក្បៀសគួរតែបំបែកឈ្មោះដូចជាគេហទំព័រនានាសម្រាប់បណ្តាញនេះ។','Menu setting enables/disables the plugin menus from appearing for non super admins, so that only super admins, not site admins, have access to activate plugins.'=>'ការកំណត់ម៉ឺនុយអាចបិទឬបើកម៉ឺនុយកម្មវិធីបន្ថែម ពីការបង្ហាញដល់អ្នកដែលមិនមែនជាអ្នកគ្រប់គ្រងកំពូល ដូចនេះ មានតែអ្នកគ្រប់គ្រងកំពូលដែលមិនមែនគ្រាន់តែជាអ្នកគ្រប់គ្រងធម្មតា ទើបអាចចូលទៅដំណើរការកម្មវិធីបន្ថែមផ្សេងៗបាន។','Users who are signed up to the network without a site are added as subscribers to the main or primary dashboard site, giving them profile pages to manage their accounts. These users will only see Dashboard and My Sites in the main navigation until a site is created for them.'=>'អ្នកប្រើដែលបានចុះឈ្មោះក្នុងបណ្ដាញដោយពុំមានវេបសាយ នឹងត្រូវបញ្ចូលជា subscribers នៃវេបសាយមេ ឬក៏ផ្ទាំងគ្រប់គ្រងចម្បងនៃវេបសាយ។ មានទំព័រព័ត៌មានផ្ទាល់ខ្លួន ដើម្បីឲ្យពួកគេអាចគ្រប់គ្រងគណនីរបស់ខ្លួនបាន។ ពួកគេទាំងនេះនឹងអាចមើលឃើញត្រឹមតែ «ផ្ទាំងគ្រប់គ្រង» និង «វេសាយនានារបស់ខ្ញុំ» នៅក្នុងម៉ឺនុយចម្បងរហូតទាល់តែមានការបង្កើតវេបសាយមួយសម្រាប់គេ។','This table shows all users across the network and the sites to which they are assigned.'=>'តារាងនេះបង្ហាញគ្រប់អ្នកប្រើទាំងអស់នៅទូទាំងបណ្តាញ នឹងវេបសាយដែលពួកគេបានកំណត់។','You can make an existing user an additional super admin by going to the Edit User profile page and checking the box to grant that privilege.'=>'អ្នក​អាច​ផ្ដល់​សិទ្ធិ​គ្រប់គ្រង​កំពូល​ដល់​អ្នក​ប្រើ​ណា​ម្នាក់ ដោយ​ចូល​ទៅ​កាន់​ទំព័រ "កែប្រែ​អ្នកប្រើ" ហើយ​ធីក​ក្នុង​ប្រអប់ ដើម្បី​ផ្ដល់​សិទ្ធិ​នោះ។','If the admin email for the new site does not exist in the database, a new user will also be created.'=>'ប្រសិន​បើ​អ៊ីមែល​អ្នក​គ្រប់គ្រង​សម្រាប់​វេបសាយ​ថ្មី​នេះ​មិន​មាន​ក្នុង​មូលដ្ឋាន​ទិន្នន័យ​ទេ​នោះ អ្នក​ប្រើ​ថ្មី​ម្នាក់​នឹង​ត្រូវ​បាន​បង្កើត​ឡើង។','Operational settings has fields for the network&#8217;s name and admin email.'=>'ការកំណត់ប្រតិបត្តិការ ត្រូវបរាជ័យសម្រាប់ឈ្មោះបណ្ដាញនឹង អ្នកគ្រប់គ្រងអ៊ីមែល។','Visit to go to the front-end site live.'=>'សូមចូលទៅមើលវេបសាយខាងមុខចុងបំផុត​ ដោយផ្ទាល់។','Deactivate, Archive, and Spam which lead to confirmation screens. These actions can be reversed later.'=>'ដាក់អោយអសកម្ម, ដាក់ជាបណ្ណសារ, និងស៉្បាម ដែលនាំទៅដល់អេក្រង់ទាមទាការបញ្ជាក់។ សកម្មភាពទាំងនេះអាចធ្វើអោយត្រឡប់វិញនៅពេលក្រោយបាន។','The site ID is used internally, and is not shown on the front end of the site or to users/viewers.'=>'លេខសំគាល់វេបសាយ គឺត្រូវប្រើនៅខាងក្នុង នឹងមិនអាចបង្ហាញ លើផ្នែកខាងមុខ ចុងបញ្ចប់នៃវេបសាយ ឬ​​ទៅអ្នកប្រើ/ អ្នកមើល។','Hovering over each site reveals seven options (three for the primary site):'=>'ការដាក់កណ្ដុរនៅលើវេបសាយនីមួយៗនឹងបង្ហាញនូវជម្រើស ៧ (ជម្រើស ៣ សម្រាប់វេបសាយដើម):','You can also go to the user&#8217;s profile page by clicking on the individual username.'=>'អ្នកអាចចូលទៅកាន់ ទំព័រទម្រង់ពត៌មានរបស់អ្នកប្រើ ដោយចុចលើឈ្មោះបុគ្គលអ្នកប្រើនោះ។','The bulk action will permanently delete selected users, or mark/unmark those selected as spam. Spam users will have posts removed and will be unable to sign up again with the same email addresses.'=>'សកម្មភាពដុលនឹងលុបជាអចិន្ត្រៃយ៍នូវអ្នកប្រើដែលបានជ្រើស។ អ្នកអាចគូសធីក ឬដកធីកអ្នកប្រើដែលបានជ្រើសទាំងនោះថាជាស្ប៉ាម។ ប្រកាសរបស់អ្នកប្រើដែលជាស្ប៉ាមនឹងត្រូវលុប ហើយអ្នកទាំងនោះនឹងពុំអាចចុះឈ្មោះដោយប្រើអ៊ីមែលដដែលម្ដងទៀតបានទេ។','Upload settings control the size of the uploaded files and the amount of available upload space for each site. You can change the default value for specific sites when you edit a particular site. Allowed file types are also listed (space separated only).'=>'ការកំណត់នៃការអាប់ឡូដ គ្រប់គ្រងនូវទំហំហ្វាល់ដែលបានអាប់ឡូដ និងទំហំដែលត្រៀមទុកសម្រាប់អាប់ឡូដនៃវេបសាយនីមួយៗ។ អ្នកអាចកែនូវតម្លៃដើមនៃវេបសាយណាមួយនៅពេលដែលអ្នកធ្វើការកែប្រែលើវា។ ប្រភេទហ្វាល់ដែលបានអនុញ្ញាត ក៏ត្រូវបានដាក់បង្ហាញផងដែរ (សូមដកឃ្លាពីប្រភេទហ្វាល់មួយទៅប្រភេទហ្វាល់មួយទៀត)។','Warning! User cannot be modified. The user %s is a network administrator.'=>'ការ​ព្រមាន! មិន​អាច​កែប្រែ​អ្នកប្រើ​នេះ​ទេ។ អ្នក​ប្រើ %s គឺ​ជា​អ្នក​គ្រប់គ្រង​បណ្ដាញ។','Enter the username and email.'=>'បញ្ចូល​ឈ្មោះ​អ្នក​ប្រើ និង​អាសយដ្ឋាន។','Select a user to change role.'=>'ជ្រើស​អ្នក​ប្រើ​ម្នាក់ ដើម្បី​ផ្លាស់ប្ដូរ​តួនាទី។','Select a user to remove.'=>'ជ្រើស​អ្នកប្រើ ដើម្បី​លុប។','User created.'=>'បាន​បង្កើត​អ្នកប្រើ។','Add User'=>'បន្ថែម​អ្នក​ប្រើ','You cannot install a network of sites with your server address.'=>'អ្នក​មិន​អាច​ដំឡើង​បណ្ដាញ​វេបសាយ​ជាមួយ​អាសយដ្ឋាន​ម៉ាស៊ីន​បម្រើ​របស់​អ្នក​បាន​ទេ។','You will need a wildcard DNS record if you are going to use the virtual host (sub-domain) functionality.'=>'អ្នកនឹង ត្រូវការ​ជំនួសការចុះបញ្ជី DNS ប្រសិនបើអ្នក ចង់ទៅប្រើមុខងារបង្ហោះជាក់ស្ដែង(អនុ-ដូមេន)។','Cannot add user.'=>'មិន​អាច​បន្ថែម​អ្នក​ប្រើ។','Sorry, you are not allowed to delete the site %s.'=>'សុំទោស, អ្នក​ពុំមានសិទ្ធិលុបវេបសាយ %s ទេ។','User is already a member of this site.'=>'អ្នក​ប្រើ​នេះ​គឺជា​សមាជិក​នៃ​វេបសាប​នេះ​រួច​ហើយ។','Site info updated.'=>'បាន​ធ្វើ​បច្ចុប្បន្នភាព​ព័ត៌មាន​វេបសាយ។','Enter the username of an existing user.'=>'បញ្ចូល​ឈ្មោះ​អ្នក​ប្រើ​សម្រាប់​ឈ្មោះ​អ្នក​ប្រើ​ដែល​មាន​ស្រាប់។','You cannot delete a theme while it is active on the main site.'=>'មិន​អាច​លុប​រូបរាង ខណៈ​ពេល​វា​សកម្ម​នៅ​លើ​តំបន់​បណ្ដាញ​ចម្បង។','Add New Site'=>'បន្ថែម​វេបសាយ​ថ្មី','Delete Themes'=>'លុបរូបរាង','Are you sure you wish to delete these themes?'=>'តើ​អ្នក​ពិត​ជា​ចង់​លុប​រូបរាង​ទាំង​នេះ​ឬ?','Yes, delete this theme'=>'បាទ, លុប​រូបរាង​​នេះ','You are about to remove the following theme:'=>'អ្នក​កំពុង​តែ​រៀបចំ​លុប​រូបរាង​ទាំង​នេះ៖','This theme may be active on other sites in the network.'=>'រូបរាង​ទាំង​នេះ​អាច​មាន​ដំណើរការ​នៅ​លើ​វេបសាយ​ខ្លះ​នៅ​ក្នុង​បណ្ដាញ។','Delete Theme'=>'លុប​រូបរាង','Network Settings'=>'ការ​កំណត់​បណ្ដាញ','Network enabled themes are not shown on this screen.'=>'បណ្ដាញបាន​បើក​រូបរាង​​ ហើយមិន​ត្រូវ​បាន​បង្ហាញ​នៅ​លើ​អេក្រង់​នេះ​ឡើយ។','Add User will set up a new user account on the network and send that person an email with username and password.'=>'"បន្ថែម​អ្នក​ប្រើ" នឹង​​រៀបចំ​គណនី​អ្នក​ប្រើ​ថ្មី​លើ​បណ្ដាញ ហើយ​ផ្ញើ​ពាក្យ​សម្ងាត់​និង​ឈ្មោះ​អ្នក​ប្រើ​ឲ្យ​អ្នក​ប្រើ​ម្នាក់​នោះ។','Theme disabled.'=>'បាន​បិទ​រូបរាង %s ។','Invalid site ID.'=>'លេខ​សម្គាល់​តំបន់​បណ្ដាញ​មិន​ត្រឹមត្រូវ។','Theme enabled.'=>'បាន​បើក​ដំណើរការ​រូបរាង %s ។','No theme selected.'=>'មិន​បាន​ជ្រើស​រូបរាង។','Sub-domains'=>'អនុ-ដូមេន','To make your installation more secure, you should also add:'=>'ដើម្បីបង្កើតនូវការដំឡើងរបស់អ្នកឲ្យមានសុវត្ថិភាពបន្ថែម, អ្នកគួរតែបន្ថែម៖','Edit Site: %s'=>'កែប្រែ​វេបសាយ៖ %s','Choose subdomains or subdirectories; this can only be switched afterwards by reconfiguring your installation. Fill out the network details, and click Install. If this does not work, you may have to add a wildcard DNS record (for subdomains) or change to another setting in Permalinks (for subdirectories).'=>'ជ្រើសរើសយក subdomains ឬមួយក៏ថតរង។ ការរើសយកនេះ អាចធ្វើបានពេលក្រោយលុះត្រាណាតែអ្នកធ្វើការកំណត់នូវការតម្លើងរបស់អ្នកឡើងវិញ។ សូមបំពេញនូវបរិយាយនៃបណ្ដាញ រួចចុចតម្លើង។ ប្រសិនបើវាមិនដំណើរការ អ្នកនឹងត្រូវការបន្ថែមនូវ wildcard DNS record (សម្រាប់ subdomains) ឬក៏ប្ដូរទៅការកំណត់ផ្សេងលើ តំណ (សម្រាប់ថតរង)។','Yes, delete these themes'=>'បាទ, លុបវេបសាយនេះ','No, return me to the theme list'=>'ទេ, ប្រគល់មកខ្ញុំវិញនូវបញ្ជី រូបរាង','The next screen for Network Setup will give you individually-generated lines of code to add to your wp-config.php and .htaccess files. Make sure the settings of your FTP client make files starting with a dot visible, so that you can find .htaccess; you may have to create this file if it really is not there. Make backup copies of those two files.'=>'ផ្ទាំងបន្ទាប់សម្រាប់ការតម្លើងបណ្ដាញនឹងផ្ដល់ឲ្យអ្នកនូវកូដមួយជួរៗដែលបង្កើតឡើងដោយឯកឯង ដើម្បីដាក់បញ្ចូលទៅក្នុងហ្វាល់ wp-config.php និង .htaccess ផងដែរ។ សូមប្រាកដថាកម្មវិធី FTP កូនរបស់អ្នកអាចមើលឃើញហ្វាល់ដែលមានឈ្មោះផ្ដើមដោយសញ្ញាចុច ដើម្បីឲ្យអ្នកអាចរកឃើញហ្វាល់ .htaccess។ អ្នកក៏អាចបង្កើតហ្វាល់នេះបានផងដែរប្រសិនបើអ្នកច្បាស់ថាមិនមានវានោះទេ។ យកល្អ គួរធ្វើការចម្លងទុកនូវហ្វាល់ទាំងពីរនេះ។','Once you complete these steps, your network is enabled and configured. You will have to log in again.'=>'ពេលដែលអ្នកសម្រេចជំហានទាំងនេះ បណ្ដាញរបស់អ្នក គឺបានបើក នឹងកំនត់រចនាសម្ព័ន្ធ។ អ្នកនឹងអាចទៅ ឡុកចូលម្តងទៀត។','Dashboard leads to the Dashboard for that site.'=>'ផ្ទាំងគ្រប់គ្រង ដឹកនាំទៅ ផ្ទាំងគ្រប់គ្រងសម្រាប់វេបសាយ។ ','Network Details'=>'លម្អិត​អំពី​បណ្ដាញ','Welcome to the Network installation process!'=>'សូម​ស្វាគមន៍​មក​កាន់​ដំណើរ​ការ​ដំឡើង​បណ្ដាញ!','Once the network is created, you may reactivate your plugins.'=>'នៅ​ពេល​បង្កើត​បណ្ដាញ​រួច​ហើយ អ្នក​អាច​បើក​ដំណើរការ​កម្មវិធី​បន្ថែម​របស់​អ្នក​ឡើង​វិញ​បាន។','Please <a href="%s">deactivate your plugins</a> before enabling the Network feature.'=>'សូម​<a href="%s">បិទ​ដំណើរការ​កម្មវិធី​បន្ថែម​របស់​អ្នក</a> មុន​ពេល​បើក​ដំណើរការ​មុខងារ "បណ្ដាញ"។','Allow site administrators to add new users to their site via the "Users &rarr; Add New" page'=>'អនុញ្ញាតអោយអ្នកគ្រប់គ្រងវេបសាយអាចបន្ថែមអ្នកប្រើថ្មីទៅវេបសាយរបស់គេ តាមរយៈទំព័រ "អ្នកប្រើ &rarr; បន្ថែមថ្មី"','Language Settings'=>'កំនត់ភាសា','Site options updated.'=>'ជម្រើស បច្ចុប្បន្នភាពវេបសាយ។','Create a Network of WordPress Sites'=>'បង្កើតបណ្ដាញ នៃវេបសាយ WordPress','Return to Dashboard'=>'ត្រឡប់​ទៅ​ទំព័រ​ព័ត៌មាន','The choice of subdirectory sites is disabled if this setup is more than a month old because of permalink problems with &#8220;/blog/&#8221; from the main site. This disabling will be addressed in a future version.'=>'ជម្រើសនៃវេបសាយដែលស្ថិតនៅក្នុងថតរងត្រូវបានបិទ ប្រសិនបើការតម្លើងនេះមានអាយុកាលលើសពីមួយខែ ព្រោះថាតំណមានបញ្ហាជាមួយនឹង &#8220;/blog/&#8221; ពីវេបសាយចម្បង។ ការបិទនេះនឹងត្រូវលើកឡើងនៅកំណែខាងមុខ។','This screen allows you to configure a network as having subdomains (<code>site1.example.com</code>) or subdirectories (<code>example.com/site1</code>). Subdomains require wildcard subdomains to be enabled in Apache and DNS records, if your host allows it.'=>'ផ្ទាំងនេះអនុញ្ញាតឲ្យអ្នកកំណត់នូវបណ្ដាញមួយដែលមាន subdomains នានា ដូចជា (<code>site1.example.com</code>) ឬក៏ថតរងនានា ដូចជា (<code>example.com/site1</code>) ជាដើម។ Subdomains ត្រូវការ wildcard subdomains ដើម្បីអាចបើកបាននៅក្នុង Apache និងនៅលើ DNS records ប្រសិនបើម៉ាស៊ីនមេរបស់អ្នកអនុញ្ញាត។','Installed Themes'=>'រូបរាង​ដែល​បាន​ដំឡើង','Themes %s'=>'រូបរាង %s','All Sites'=>'វេបសាយ​ទាំងអស់','The Network creation panel is not for WordPress MU networks.'=>'បន្ទះបណ្ដាញ គឺមិនមានសម្រាប់បណ្ដាញWordPress MUទេ។','Site added. <a href="%1$s">Visit Dashboard</a> or <a href="%2$s">Edit Site</a>'=>'បាន​បន្ថែមវេបសាយ។ <a href="%1$s">មើល​ទំព័រ​ព័ត៌មាន</a> ឬ <a href="%2$s">កែប្រែ​វេបសាយ</a>','Add New takes you to the Add New Site screen. You can search for a site by Name, ID number, or IP address. Screen Options allows you to choose how many sites to display on one page.'=>'Add New នាំអ្នកទៅកាន់ផ្ទាំង Add New Site។ អ្នកអាចស្វែងរកវេបសាយដោយប្រើឺឈ្មោះ, លេខ ID, ឬអាសយដ្ឋាន IP។ Screen Options អនុញ្ញាតឱ្យអ្នកអាចជ្រើសបានវេបសាយសម្រាប់បង្ហាញលើទំព័រមួយបានតាមតម្រូវការ។','themeAdd New'=>'បន្ថែម​ថ្មី','Addresses of Sites in your Network'=>'អាសយដ្ឋាន​នៃ​វេបសាយ​នានា​នៅ​ក្នុង​បណ្ដាញ​របស់​អ្នក','subdomain exampleslike <code>site1.%1$s</code> and <code>site2.%1$s</code>'=>'ដូច <code>វេបសាយ1.%1$s</code> នឹង <code>វេបសាយ2.%1$s</code>','Network'=>'បណ្ដាញ','Clicking on bold headings can re-sort this table.'=>'ចុចលើក្បាលដិតអាច តម្រៀបតារាងនេះឡើងវិញ។','Delete which is a permanent action after the confirmation screens.'=>'លុបអ្វីដែលជាសកម្មភាពអចិន្រ្តៃយ៍ ក្រោយពីអេក្រង់បញ្ជាក់។','Sub-directories'=>'ទីតាំងថតរង','An Edit link to a separate Edit Site screen.'=>'កែតំណភ្ជាប់ ទៅដោយឡែកពីអេក្រង់កែវេបសាយ។','This screen is for Super Admins to add new sites to the network. This is not affected by the registration settings.'=>'ស្គ្រីន​នេះ​ទុក​សម្រាប់ អ្នក​គ្រប់គ្រង​ធំ បន្ថែម​វេបសាយ​ថ្មីៗ​ទៅ​ក្នុង​ណិតវើក។ វា​មិន​ទទួល​ការ​ប៉ះពាល់​ដោយ​ការ​កំណត់​ការ​ចុះបញ្ជី​ទេ។','Updates'=>'បច្ចុប្បន្នភាព','ERROR: The network could not be created.'=>'កំហុស៖ បណ្ដាញណែតវើក មិនត្រូវបានបង្កើត។','Themes can be enabled on a site by site basis by the network admin on the Edit Site screen (which has a Themes tab); get there via the Edit action link on the All Sites screen. Only network admins are able to install or edit themes.'=>'រូបរាងអាចដាក់អោយដំណើរការនៅលើមូលដ្ឋានវេបសាយផ្សេងៗគ្នាដោយអ្នកគ្រប់គ្រងបណ្ដាញនៅលើផ្ទាំង «កែវេបសាយ» (ដែលមានធែប «រូបរាង»)។ ចូលទៅកាន់តំណ «កែប្រែ» នៅលើ ផ្ទាំង «វេបសាយទាំងអស់»។ មានតែអ្នកគ្រប់គ្រងបណ្ដាញប៉ុណ្ណោះដែលអាចតម្លើង ឬក៏ធ្វើការកែប្រែរូបរាងបាន។','Super admins can no longer be added on the Options screen. You must now go to the list of existing users on Network Admin > Users and click on Username or the Edit action link below that name. This goes to an Edit User page where you can check a box to grant super admin privileges.'=>'លែង​អាច​បន្ថែម អ្នក​គ្រប់គ្រង​ធំ នៅ​ក្នុង​ស្គ្រីន ជម្រើស ទៀត​ហើយ។ អ្នក​ត្រូវតែ​ទៅ​កាន់​បញ្ជី​នៃ​អ្នកប្រើ​ដែល​មាន នៅឯ​ស្គ្រីន អ្នក​គ្រប់គ្រង​ណិតវើក > អ្នកប្រើ ហើយ​ចុច​លើ ឈ្មោះ​អ្នកប្រើ ឬ តំណ​សម្រាប់​កែសម្រួល​ដែល​ស្ថិត​នៅ​ក្រោម​ឈ្មោះ​នោះ។ ធ្វើ​បែប​នេះ អ្នក​នឹង​ទៅ​ដល់​ទំព័រ​កែសម្រួល​អ្នកប្រើ ដែល​អ្នក​អាច​ផ្ដល់​សិទ្ធិ​ជា អ្នក​គ្រប់គ្រង​ធំ ទៅ​ឱ្យ​អ្នក​ប្រើ​ម្នាក់​នោះ។','Once you add this code and refresh your browser, multisite should be enabled. This screen, now in the Network Admin navigation menu, will keep an archive of the added code. You can toggle between Network Admin and Site Admin by clicking on the Network Admin or an individual site name under the My Sites dropdown in the Toolbar.'=>'ភ្លាមៗនៅពេលដែលអ្នកបញ្ចូលកូដនេះ ហើយធ្វើការផ្ទុកឡើងវិញនូវកម្មវិធីរុករករបស់អ្នក នោះ multisite នឹងត្រូវបានដំណើរការ។ ពេលនេះ នៅលើម៉ឺនុយរុករកនៃផ្ទាំង «អ្នកគ្រប់គ្រងបណ្ដាញ» នឹងមានការរក្សាទុកនូវកូដដែលបានបញ្ចូល។ អ្នកអាចបិទបើករវាង «អ្នកគ្រប់គ្រងបណ្ដាញ» និង «អ្នកគ្រប់គ្រងវេបសាយ» ដោយចុចលើ «អ្នកគ្រប់គ្រងបណ្ដាញ» ឬក៏វេបសាយណាមួយដែលនៅពីក្រោមម៉ឺនុយកូន «វេបសាយរបស់ខ្ញុំ» នៅលើរបារឧបករណ៍។','Subdirectory networks may not be fully compatible with custom wp-content directories.'=>'បណ្ដាញដែលដាក់នៅក្នុងថតរងអាចនឹងដើរមិនពេញលេញជាមួយនឹងថត wp-content ផ្ទាល់ខ្លួន។','New site created by %1$s

Address: %2$s
Name: %3$s'=>'វេបសាយ​ថ្មី​ត្រូវ​បាន​បង្កើត​ដោយ %1$s

អាសយដ្ឋាន៖ %2$s
ឈ្មោះ៖ %3$s','Upgrade Network'=>'ធ្វើ​វិសិដ្ឋកម្ម​បណ្ដាញ','WordPress has been updated! Before we send you on your way, we need to individually upgrade the sites in your network.'=>'WordPress ត្រូវ​បាន​ធ្វើ​បច្ចុប្បន្នភាព! មុន​ពេល​យើង​ផ្ញើ​ឲ្យ​អ្នក​, យើង​ត្រូវ​ធ្វើ​បច្ចុប្បន្នភាពវេបសាយក្នុង​បណ្ដាញ​របស់​អ្នក។','Welcome to your Network Admin. This area of the Administration Screens is used for managing all aspects of your Multisite Network.'=>'ស្វាគមន៍​មក​កាន់​ផ្នែក​គ្រប់គ្រង​បណ្ដាញ។ ទី​នេះ​គឺ​ជា​ផ្នែក​គ្រប់គ្រង​ដែល​ត្រូវ​បាន​ប្រើ​សម្រាប់​គ្រប់គ្រង​គ្រប់​ចំណុច​ទាំង​អស់​នៃ​បណ្ដាញ​ពហុ​វេបសាយ (Multisite Network) របស់​អ្នក។','From here you can:'=>'នៅ​ទីនេះ អ្នក​អាច៖','Add and manage sites or users'=>'បន្ថែម និង​គ្រប់គ្រង​តំបន់​បណ្ដាញ ឬ​អ្នក​ប្រើ','Install and activate themes or plugins'=>'ដំឡើងង និង​បើក​ដំណើរការ​រូបរាង ឬ​កម្មវិធី​បន្ថែម','Only use this screen once you have updated to a new version of WordPress through Updates/Available Updates (via the Network Administration navigation menu or the Toolbar). Clicking the Upgrade Network button will step through each site in the network, five at a time, and make sure any database updates are applied.'=>'ប្រើតែ​ស្គ្រីន​នេះ នៅ​ពេល​អ្នក​បាន​អាប់ដេត​ទៅ​កំណែ​ថ្មី​នៃ WordPress តាមរយៈ ការ​អាប់ដេត/ការ​អាប់ដេត​ដែល​មាន (ចូល​តាម​ម៉ឺនុយ ការ​គ្រប់គ្រង​ណិតវើក ឬ របារ​ឧបករណ៍)។ ការ​ចុច​ប៊ូតុង អាប់គ្រេត​ណិតវើក នឹង​ធ្វើការ​ទៅ​លើ​វេបសាយ​នីមួយៗ​នៅ​ក្នុង​ណិតវើក ពោលគឺ​ប្រាំ​ក្នុង​មួយ​លើក ហើយ​ប្រាកដ​ថា​បាន​អនុវត្ត​ការ​អាប់ដេត​មូលដ្ឋាន​ទិន្នន័យ​នានា។','Update your network'=>'ធ្វើ​បច្ចុប្បន្នភាព​បណ្ដាញ​របស់​អ្នក','Modify global network settings'=>'កែប្រែ​ការ​កំណត់​សាកល​នៃ​បណ្ដាញ','The Right Now widget on this screen provides current user and site counts on your network.'=>'ឥឡូវនេះ វិដជិតនៅលើអេក្រង់នេះ ដែលផ្ដល់ដោយអ្នកប្រើបច្ចុប្បន្ន នឹងរាប់វេបសាយ លើបណ្ដាញរបស់អ្នក។','To search for a user or site, use the search boxes.'=>'ប្រើ​ប្រអប់​ស្វែងរក ដើម្បី​ស្វែងរក​អ្នក​ប្រើ ឬ​តំបន់​បណ្ដាញ។','Quick Tasks'=>'ភារកិច្ច​រហ័ស','To add a new user, <strong>click Create a New User</strong>.'=>'<strong>ចុច បង្កើត​អ្នក​ប្រើ​ថ្មី</strong> ដើម្បី​បន្ថែម​អ្នក​ប្រើ​ថ្មី​ម្នាក់។','To add a new site, <strong>click Create a New Site</strong>.'=>'<strong>ចុច បង្កើត​វេបសាយ​ថ្មី</strong> ដើម្បី​បន្ថែម​វេបសាយ​ថ្មី​មួយ។','To search for a user, <strong>enter an email address or username</strong>. Use a wildcard to search for a partial username, such as user&#42;.'=>'<strong>បញ្ចូល​អាសយដ្ឋាន​អ៊ីមែល​ឬ​ឈ្មោះ​អ្នក​ប្រើ</strong> ដើម្បី​ស្វែងរក​អ្នកប្រើ​ណា​ម្នាក់។ អ្នក​ក៏​អាច​ប្រើ​តួ​អក្សរ wildcard ដើម្បី​ស្វែងរក​បំណែក​ឈ្មោះ ដូច​ជា user&#42; ជាដើម។','To search for a site, <strong>enter the path or domain</strong>.'=>'<strong>បញ្ចូល​ដូមេន​ឬ​ទីតាំង</strong> ដើម្បី​ស្វែងរក​វេបសាយ​ណាមួយ។','Add the following to your %1$s file in %2$s, <strong>replacing</strong> other WordPress rules:'=>'បន្ថែម​របស់​ទាំង​នេះ​ទៅ​ក្នុង​ឯកសារ %1$s នៅ​ក្នុង %2$s, <strong>ដោយ​ជំនួស​លើ</strong>​ច្បាប់​ដទៃ​នៃ WordPress៖','Confirm your action'=>'បញ្ជាក់​សកម្មភាព​របស់​អ្នក','<a href="https://codex.wordpress.org/Network_Admin_Updates_Screen">Documentation on Upgrade Network</a>'=>'<a href="https://codex.wordpress.org/Network_Admin_Updates_Screen">ឯកសារ​ស្ដី​អំពី​ការ​ដំឡើងកំណែបណ្ដាញ</a>','<a href="https://codex.wordpress.org/Network_Admin_Settings_Screen">Documentation on Network Settings</a>'=>'<a href="https://codex.wordpress.org/Network_Admin_Settings_Screen">ឯកសារស្តីពីការកំណត់នានារបស់បណ្ដាញ</a>','<a href="https://codex.wordpress.org/Network_Admin_Users_Screen">Documentation on Network Users</a>'=>'<a href="https://codex.wordpress.org/Network_Admin_Users_Screen">ឯកសារស្តីពីអ្នកប្រើប្រាស់លើបណ្តាញ</a>','<a href="https://codex.wordpress.org/Network_Admin">Documentation on the Network Admin</a>'=>'<a href="https://codex.wordpress.org/Network_Admin">កម្រង​អត្ថបទ​ស្ដី​អំពីផ្នែក​គ្រប់គ្រង​បណ្ដាញ</a>','Hover over any user on the list to make the edit links appear. The Edit link on the left will take you to their Edit User profile page; the Edit link on the right by any site name goes to an Edit Site screen for that site.'=>'ដាក់​ចង្អុល​លើ​អ្នក​ប្រើ​ណា​ម្នាក់​ក្នុង​បញ្ជី ដើម្បី​ឲ្យ​តំណ​កែប្រែ​បង្ហាញ​ឡើយ។ តំណ​កែប្រែ​ដែល​ស្ថិត​នៅ​ខាង​ឆ្វេង​នឹង​នាំ​អ្នក​ទៅ​ទំព័រ​កែប្រែ​ព័ត៌មាន​របស់​អ្នក​ប្រើប្រាស់។ ចំណែក​តំណ​ដែល​ស្ថិត​នៅ​ខាង​ស្ដាំ​ឈ្មោះ​វេបសាយ នឹង​នាំ​ទៅ​ទំព័រ​កែប្រែ​ព័ត៌មាន​សម្រាប់​វេបសាយ​នោះ។','<a href="https://codex.wordpress.org/Tools_Network_Screen">Documentation on the Network Screen</a>'=>'<a href="https://codex.wordpress.org/Tools_Network_Screen">ឯកសារស្តីពីអេក្រង់បណ្ដាញ</a>','<a href="https://codex.wordpress.org/Create_A_Network">Documentation on Creating a Network</a>'=>'<a href="https://codex.wordpress.org/Create_A_Network">ឯកសារស្តីពីការបង្កើតបណ្ដាញ</a>','<a href="https://codex.wordpress.org/Network_Admin_Themes_Screen">Documentation on Network Themes</a>'=>'<a href="https://codex.wordpress.org/Network_Admin_Themes_Screen">ឯកសារស្តីពីរូបរាងរបស់បណ្ដាញ</a>','Warning! Problem updating %1$s. Your server may not be able to connect to sites running on it. Error message: %2$s'=>'បម្រាប់ ! ការធ្វើបច្ចុប្បន្នភាព %1$s មានបញ្ហា។ ម៉ាស៊ីនបម្រើរបស់អ្នក មិនត្រូវបានភ្ជាប់ទៅកាន់វេបសាយដែលកំពុងដំនើរការលើវាទេ។ សារកំហុស៖ %2$s','%s theme deleted.'=>'រូបរាង %s ត្រូវបានលុប។','%s theme enabled.'=>'រូបរាង %s បានបើកដំនើរការ។','%s theme disabled.'=>'រូបរាង %s បានបិទដំនើរការ។','Are you sure you wish to delete this theme?'=>'តើអ្នកពិតជា ចង់លុបរូបរាងនេះឬ?','These themes may be active on other sites in the network.'=>'រូបរាងទាំងនេះ អាចនឹងត្រូវបានសកម្មនៅលើ វេបសាយផ្សេងទៀតក្នុង បណ្តាញ។','You are about to remove the following themes:'=>'អ្នកប្រហែលជាត្រូវយករូបរាងចេញតាមលំនាំខាងក្រាម៖ ','Enable menus'=>'ដំនើរការ ម៉ឺនុយ','Set site attributes'=>'កំណត់ការទាមទារ វេបសាយ','Allowed file types. Separate types by spaces.'=>'ប្រភេទឯកសារដែលអនុញ្ញាត។ ចែកប្រភេទពីគ្នា ដោយចន្លោះ។ ','Size in kilobytes'=>'ទំហំក្នុង គីឡូបៃ','New registrations settings'=>'ការកំណត់ការចុះឈ្មោះថ្មី','The requested site does not exist.'=>'វេបសាយដែលបានស្នើ មិនមានទេ។','You are about to activate the site %s.'=>'អ្នក​រៀបនឹង ​ធ្វើឲ្យ​វេបសាយ %s សកម្ម។','You are about to deactivate the site %s.'=>'អ្នក​រៀបនឹង​ ធ្វើឲ្យវេបសាយ %s អសកម្ម។','You are about to unarchive the site %s.'=>'អ្នក​រៀបនឹង​ដក​វេបសាយ %s ចេញ​ពី​បណ្ណសារ។','You are about to archive the site %s.'=>'អ្នក​រៀបនឹង​ដាក់​វេបសាយ %s ជា​បណ្ណសារ។','You are about to unspam the site %s.'=>'អ្នក​រៀបនឹង​ដក​វេបសាយ %s ចេញ​ពី​ស្ប៉ាម។','You are about to mark the site %s as spam.'=>'អ្នក​រៀបនឹង​សម្គាល់​វេបសាយ %s ថា​ជា​ស្ប៉ាម។','You are about to delete the site %s.'=>'អ្នក​រៀបនឹង​លុប​វេបសាយ %s ។','You are about to mark the site %s as mature.'=>'អ្នក រៀបនឹងសម្គាល់វេបសាយ %s ថាជាចាស់ទុំ។','You are about to mark the site %s as not mature.'=>'អ្នក រៀបនឹងសម្គាល់វេបសាយ %s ថាមិនទាន់ចាស់ទុំ។','The requested action is not valid.'=>'សកម្មភាពដែលបានស្នើ មិនត្រឹមត្រូវ។','The domain or path entered conflicts with an existing username.'=>'ដូមេន​ ឬផ្នែកដែលបានបញ្ចូលប្រឆាំងជាមួយ ឈ្មោះអ្នកប្រើដែលមានស្រាប់។','Filter site themes list'=>'ច្រោះបញ្ជីរូបរាងវេបសាយ','Site themes list navigation'=>'បញ្ជីរុករករូបរាងវេបសាយ','Site themes list'=>'បញ្ជីរូបរាង វេបសាយ','Filter site users list'=>'ច្រោះ បញ្ជីអ្នកប្រើវេបសាយ','Site users list navigation'=>'រុករកបញ្ជីអ្នកប្រើវេបសាយ','Site users list'=>'បញ្ជី​អ្នក​ប្រើប្រាស់​វេបសាយ','Sites list navigation'=>'រុករកបញ្ជីវេបសាយ','Sites list'=>'បញ្ជី​វេបសាយ','Themes list navigation'=>'រុករកបញ្ជី​ រូបរាង','You must define the %1$s constant as true in your %2$s file to allow creation of a Network.'=>'អ្នក​ត្រូវតែ​កំណត់​តម្លៃ​ថេរ %1$s ទៅជា true (ពិត) នៅ​ក្នុង​ឯកសារ %2$s របស់​អ្នក ដើម្បី​អនុញ្ញាត​ឱ្យ​អាច​បង្កើត​ណិតវើក។','If registration is disabled, please set %1$s in %2$s to a URL you will redirect visitors to if they visit a non-existent site.'=>'ប្រសិនបើ​ការ​ចុះបញ្ជី​ត្រូវបាន​បិទ សូម​កំណត់ %1$s នៅក្នុង %2$s ទៅកាន់ URL ដែល​អ្នក​នឹង​ប្ដូរទិសដៅ​អ្នក​ចូល​មើល​វេបសាយ​របស់​អ្នក ប្រសិនបើ​ពួកគេ​ចូល​មើល​វេបសាយ​ដែល​មិនមាន។','A password reset link will be sent to the user via email.'=>'បាន​ផ្ញើ​អ៊ីមែល​នូវ​តំណ​សម្រាប់​កំណត់​ពាក្យ​សម្ងាត់​ឡើង​វិញ ទៅ​ឱ្យ