look at the <a href="%2$s">Apache documentation</a> or <a href="%3$s">elsewhere</a> for help setting it up.'=>'ប្រសិនបើ %1$s មិន​ដំណើរការ, សូម​សាកសួរ​អ្នក​គ្រប់គ្រង​របស់​អ្នក ដើម្បី​បើក​ម៉ូឌុល​នោះ ឬ​ចូល​មើល​នៅ​ក្នុង <a href="%2$s">កម្រងឯកសារ Apache</a> ឬ <a href="%3$s">កន្លែង​មួយ​ទៀត</a> សម្រាប់​ជំនួយ​ក្នុង​ការ​រៀបចំ​ដំឡើង។','Please choose whether you would like sites in your WordPress network to use sub-domains or sub-directories.'=>'សូម​សម្រេចចិត្ត​ថា តើ​អ្នក​ចង់​ឱ្យ​វេបសាយ​ក្នុង​ណិតវើក WordPress ប្រើប្រាស់ ឈ្មោះ​ដូមែន​រង ឬ ទីតាំង​ផ្ទុក​រង។','You cannot change this later.'=>'អ្នកមិនអាចប្ដូរ នៅពេលក្រាយបានទេ។','We recommend you change your siteurl to %1$s before enabling the network feature. It will still be possible to visit your site using the %3$s prefix with an address like %2$s but any links will not have the %3$s prefix.'=>'ពួកយើង​សូម​ណែនាំ​ឱ្យ​អ្នក​ផ្លាស់ប្ដូរ URL វេបសាយ​របស់​អ្នក​ទៅ​ជា %1$s មុន​ពេល​បើក​មុខងារ​ណិតវើក។ វា​នឹង​នៅ​តែ​អាច​ចូល​មើល​បាន​ដោយ​ប្រើ​អក្សរ​ផ្ដើម %3$s ជាមួយ​នឹង​អាសយដ្ឋាន​ដូចនេះ %2$s ក៏​ប៉ុន្តែ​តំណ​ផ្សេងៗ​ទៀត​មិនមាន​អក្សរ​ផ្ដើម %3$s ទេ។','The internet address of your network will be %s.'=>'អាសយដ្ឋាន​អ៊ីនធឺណិត​សម្រាប់​ណិតវើក​របស់​អ្នក​គឺ %s។','We recommend you back up your existing %1$s and %2$s files.'=>'ពួកយើង​សូម​ណែនាំ​ឱ្យ​អ្នក​បម្រុងទុក​ឯកសារ %1$s និង %2$s។','We recommend you back up your existing %s file.'=>'ពួកយើង​សូម​ណែនាំ​អ្នក​ឱ្យ​បម្រុង​ទុក​ឯកសារ %s។','This unique authentication key is also missing from your %s file.'=>'សោ​ផ្ទៀងផ្ទាត់​ពិសេស​មួយ​នេះ​ក៏​មិនមាន​នៅ​ក្នុង​ឯកសារ %s របស់​អ្នក​ដែរ។','These unique authentication keys are also missing from your %s file.'=>'សោ​ផ្ទៀងផ្ទាត់​ពិសេស​ទាំង​នេះ​ក៏​មិនមាន​នៅ​ក្នុង​ឯកសារ %s របស់​អ្នក​ដែរ។','email "From" fieldSite Admin'=>'អភិបាល​វេបសាយ','Only lowercase letters (a-z), numbers, and hyphens are allowed.'=>'ប្រើបាន​តែ​អក្សរ​តូច (a-z), លេខ, និង​សញ្ញាដក តែ​ប៉ុណ្ណោះ។','Because you are using %1$s, the sites in your WordPress network must use sub-directories. Consider using %2$s if you wish to